import message from './Messsage.module.css';

function Message(props) {
    return (
        <div>
            <img src={`img/${props.ava}`} alt="book" width="30" height="30"/>
            <div className={message.message_item}>{props.content}</div>
        </div>
    );
}

export default Message;
